import React from 'react';

class QuestionDecriptionComponent extends React.Component {
    constructor() {
        super();
    }


    render() {
        return (
          <div>
              Problem Name: <input type="text" name="problemName" />
              Problem Decription: <input type="text" name="problemDescription" />
              Text Case File: <input type="text" name="textCases" />
              Expected Output File: <input type="text" name="outputFile" />
          </div>
        );
    }
}

  export default QuestionDecriptionComponent;
